import React from 'react'
import { Box, AppBar, Toolbar, Avatar, Typography, List, ListItem, ListItemButton, ListItemText, Drawer } from "@mui/material"

const navItems = ['About', 'Work Experience', 'Projects', 'Contact']

export const NavBar = () => {

    const drawer = (
        <List>
            {navItems.map((item) => (
                <ListItem key={item} disablePadding>
                    <ListItemButton sx={{ textAlign: 'center' }}>
                        <ListItemText primary={item} />
                    </ListItemButton>
                </ListItem>
            ))}
        </List>
    )

    return (
        <Box>
            <AppBar position="static">
                <Toolbar
                sx={{ justifyContent: 'space-between' }}
                >
                    <Box
                        display={'flex'}
                        sx={{
                            alignItems: 'center'
                        }}
                        gap={1}
                    >
                        <Avatar alt="William Ho" src={`${process.env.PUBLIC_URL}/selfimage.jpg`} />
                        <Typography>WILLIAM HO</Typography>
                    </Box>
                    <Box
                    display={'flex'}
                    gap={1}
                    >
                        <Typography>About</Typography>
                        <Typography>Work experience</Typography>
                        <Typography>Projects</Typography>
                        <Typography>Contact</Typography>
                    </Box>



                </Toolbar>
            </AppBar>
        </Box>
    )
}
